    dm.getDataByTag('panel' + i).a('title', i + '신호배수펌프');
    dm.getDataByTag('panel' + i).a('params1', '개방');
    dm.getDataByTag('panel' + i).a('value1', '폐쇄');
    dm.getDataByTag('panel' + i).a('params2', '순환횟수');
