    dm.getDataByTag('panel' + i).a('params5', '액상');
    dm.getDataByTag('panel' + i).a('params6', '운행 시간');
}
var tn = setInterval(function(){
    var random = Math.random() * (30 - 10 + 1) + 10; 
    var randomTime = Math.random() * (20 - 2 + 1) + 2;
    for(var i = 1; i < 7; i++){
        dm.getDataByTag('panel' + i).a('value2' , (random).toFixed(2) + '    HZ');
        dm.getDataByTag('panel' + i).a('value3' , (random * 0.8 * i).toFixed(2)+ '    HZ');
        dm.getDataByTag('panel' + i).a('value4' , (random * 0.6 * i).toFixed(2) + '    A');
        dm.getDataByTag('panel' + i).a('value5' , (random * 0.8 + i).toFixed(2) + '    %');
        dm.getDataByTag('panel' + i).a('value6' , (randomTime + i).toFixed(2) +'    h'); 
        dm.getDataByTag('panel' + i).a('status')?dm.getDataByTag('panel' + i).a('status', false):dm.getDataByTag('panel' + i).a('status', true);
